import ProfileIndexMenu from './profileIndexMenu';
import ProfileListContent from './profileListContent';
import SimpleBarReact from 'simplebar-react';

// Extends ProfileList //
export default function ProfileListContainer(props) {
  const renderListItems = () => {
    return totalToRender(props.profileDataToRender, props.totalToRenderNumber).map((item, i) => (
      <ProfileListItem 
          key        = {`ListItem${i}`}
          style      = {props.style}
          data       = {item}
          setFocused = {props.setFocused}/>
    ))
  }

  const renderListContainer = listName => {
    return (
      <div>
        <ProfileIndexMenu 
            style               = {props.style}
            profileDataToRender = {props.profileDataToRender[listName.toLowerCase()]}/>

        {renderListItems()}

        {/* <ProfileListContent 
            style               = {props.style}
            profileDataToRender = {props.profileDataToRender[listName.toLowerCase()]}
            totalToRenderNumber = {props.totalToRenderNumber}
            setFocused          = {props.setFocused}/> */}
      </div>
    )
  }

  return (
    <SimpleBarReact 
        style={props.style.listContainer}>

        {
          props.listToRender.map((listName, i) => (
            <div key={`ListContainer${i}`}>
              {renderListContainer(listName)}
            </div>
          ))
        }
    </SimpleBarReact>
  )
}
